import React from "react";

const navbar = () => {
  return (
    <nav className='bg-orange-500 flex flex-col md:flex-row justify-between '>
      <div>
        <span className='text-2xl text-gray-500 font-bold '>Local Market</span>
      </div>
      <ul className='flex  justify-between '>
        <li>signup</li>
        <li>signin</li>
        <li>order</li>
        <li>transaction</li>
        <li>logout</li>
      </ul>
    </nav>
  );
};

export default navbar;
